def getSuitFromNumber(number: int) -> Suit:
    match number:
        case 1:
            return Suit.Suit([0, 0, 0, 0, 0, 0, 0, 0, 1])
        case 2:
            return Suit.Suit([0, 0, 0, 0, 0, 0, 0, 0, 2])
        case 4:
            return Suit.Suit([0, 0, 0, 0, 0, 0, 0, 0, 4])
        case 5:
            return Suit.Suit([0, 0, 0, 0, 0, 0, 0, 1, 4])
        case 7:
            return Suit.Suit([0, 0, 0, 0, 0, 0, 0, 3, 4])
        case 8:
            return Suit.Suit([0, 0, 0, 0, 0, 0, 0, 4, 4])
        case 10:
            return Suit.Suit([0, 0, 0, 0, 0, 0, 2, 4, 4])
        case 11:
            return Suit.Suit([0, 0, 0, 0, 0, 0, 3, 4, 4])
        case 13:
            return Suit.Suit([0, 0, 0, 0, 0, 1, 4, 4, 4])


def getIrreducible(suit):
    if tuple(suit.suit) in getWaiting():
        return set({getWaiting()[tuple(suit.suit)]['number']})

    hand = Hand.Hand(suit, False)
    result = set()

    if not hand.isTempai():
        return result

    if suit.isRegularForm() and suit.sum() >= 10:
        suits = Remove.getRemovedAtamaConnectedShuntsuPatterns(suit)
        for checkSuit in suits:
            checkHand = Hand.Hand(checkSuit, False)
            if not checkHand < hand:
                result |= getIrreducible(checkSuit)

    if suit.isRegularForm():
        suits = Remove.getRemovedAtamaPatterns(suit)
        for checkSuit in suits:
            checkHand = Hand.Hand(checkSuit, False)
            if not checkHand < hand:
                result |= getIrreducible(checkSuit)

    suits = Remove.getRemovedMentsuPatterns(suit)
    for checkSuit in suits:
        checkHand = Hand.Hand(checkSuit, False)
        if not checkHand < hand:
            result |= getIrreducible(checkSuit)

    return result

